// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NftMarket is ERC721URIStorage, Ownable{
    using Counters for Counters.Counter;

    struct NftItem {
        uint tokenId;
        uint price;
        address creator;
        bool isListed;
    }

    uint public listingPrice = 0.025 ether;

    // listed items in this market
    Counters.Counter private _listedItems;
    // new tokens generated
    Counters.Counter private _tokenIds;

    mapping(string => bool) private _usedTokenURIs;
    mapping(uint => NftItem) private _idToNftItem;

    mapping(address => mapping(uint=>uint)) private _ownedTokens;
    mapping(uint => uint) private _idToOwnedIndex;

    // all tokenIds in the array
    uint256[] private _allNfts;
    mapping(uint => uint) private _idToNftIndex;

    event NftItemCreated(
        uint tokenId,
        uint price,
        address creator,
        bool isListed
    );

    constructor() ERC721("CreaturesNft","CNFT"){}

    function setListingPrice(uint newPrice) external onlyOwner {
        require(newPrice !=listingPrice, "Price must not be same");
        listingPrice = newPrice;
    }

    function tokenURIExists(string memory tokenURI) public view returns (bool) {
        return _usedTokenURIs[tokenURI] == true;
    }

    function listedItemsCount() public view returns (uint){
        return _listedItems.current();
    }

    function getNftItem(uint tokenId) public view returns (NftItem memory){
        return _idToNftItem[tokenId];
    }

    function totalSupply() public view returns (uint) {
        return _allNfts.length;
    }

    function tokenByIndex(uint index) public view returns (uint){
        require(index < totalSupply(), "Index out of bounds");
        return _allNfts[index];
    }

    function tokenOfOwnerByIndex(address owner, uint index) public view returns (uint){
        require(index < ERC721.balanceOf(owner), "Index out of bounds");
        return _ownedTokens[owner][index];
    }

    function getAllNftsOnSale() public view returns (NftItem[] memory){
        uint allItemsCount = totalSupply();
        uint currentIndex = 0;
        NftItem[] memory items = new NftItem[](_listedItems.current());
        for(uint i=0; i < allItemsCount; i++){
            uint tokenId = tokenByIndex(i);
            NftItem storage item = _idToNftItem[tokenId];

            if(item.isListed == true){
                items[currentIndex] = item;
                currentIndex+=1;
            }

        }

        return items;
    }

    function getOwnedNfts() public view returns (NftItem[] memory){
        uint ownedItemsCount = ERC721.balanceOf(msg.sender);
        NftItem[] memory items = new NftItem[](ownedItemsCount);
        for(uint i=0; i<ownedItemsCount; i++){
            uint tokenId = tokenOfOwnerByIndex(msg.sender, i);
            NftItem storage item = _idToNftItem[tokenId];
            items[i] = item;
        }

        return items;
    }

    // no need of burn token
    // function burnToken(uint tokenId) public {
    //     _burn(tokenId);
    // }

    // mint means genearte new token/nft
    function mintToken(string memory tokenURI, uint price) public payable returns(uint) {
        require(!tokenURIExists(tokenURI), "Token URI already exists");
        require(msg.value == listingPrice, "Price must be equal to listing price");

        _tokenIds.increment();
        _listedItems.increment();

        uint newTokenId = _tokenIds.current();

        _safeMint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        _usedTokenURIs[tokenURI] = true;
        _createNftItem(newTokenId, price);

        return newTokenId;
    }

    function buyNft(uint tokenId) public payable{
        uint price = _idToNftItem[tokenId].price;
        address owner = ERC721.ownerOf(tokenId);

        require(msg.sender != owner, "You already owns this NFT");
        require(msg.value == price, "Please submit the asking price");

        _idToNftItem[tokenId].isListed = false;
        _listedItems.decrement();

        _transfer(owner, msg.sender, tokenId);
        payable(owner).transfer(msg.value);

    }

    function placeNftOnSale(uint tokenId, uint newPrice) public payable {
        require(ERC721.ownerOf(tokenId) == msg.sender, "You are not the owner of nft");
        require(_idToNftItem[tokenId].isListed == false, "Item is already on sale");
        require(msg.value == listingPrice, "Price must be equal to listing price");

        _idToNftItem[tokenId].isListed = true;
        _idToNftItem[tokenId].price = newPrice;
        _listedItems.increment();

    }

    function _createNftItem(
        uint tokenId, 
        uint price) private {
        require(price > 0, "Price must be at least 1 wei");
        _idToNftItem[tokenId] = NftItem(
            tokenId, 
            price, 
            msg.sender,
            true
        );

        emit NftItemCreated(tokenId, price, msg.sender, true);
    }   

    function _beforeTokenTransfer(
        address from,
        address to,
        uint tokenId) internal virtual override{

        super._beforeTokenTransfer(from, to, tokenId);

        // minting token
        if(from == address(0)){
            _addTokenToAllTokensEnumeration(tokenId);
        } else 
        // transfering token
        if(from !=to){
            _removeTokenFromOwnerEnumeration(from, tokenId);
        }

        // burn token
        if(to == address(0)){
            _removeTokenFromAllTokensEnumeration(tokenId);
        } else if(to != from){
            _addTokenToOwnerTokensEnumeration(to, tokenId);
        }

    }

    function _addTokenToAllTokensEnumeration(uint tokenId) private {
        _idToNftIndex[tokenId] = _allNfts.length;
        _allNfts.push(tokenId);
    }

    function _addTokenToOwnerTokensEnumeration(address to, uint tokenId) private {
        uint length = ERC721.balanceOf(to);
        _ownedTokens[to][length] = tokenId;
        _idToOwnedIndex[tokenId] = length;
    }

    function _removeTokenFromOwnerEnumeration(address from, uint tokenId) private {
        uint lastTokenIndex = ERC721.balanceOf(from) - 1;
        uint tokenIndex = _idToOwnedIndex[tokenId];

        if(tokenIndex != lastTokenIndex) {
            uint lastTokenId = _ownedTokens[from][lastTokenIndex];

            _ownedTokens[from][tokenIndex] = lastTokenIndex;
            _idToOwnedIndex[lastTokenId] = tokenIndex;
        }

        delete _idToOwnedIndex[tokenId];
        delete _ownedTokens[from][lastTokenIndex];
    }

    function _removeTokenFromAllTokensEnumeration(uint tokenId) private {
        uint lastTokenIndex = _allNfts.length - 1;
        uint tokenIndex = _idToNftIndex[tokenId];
        uint lastTokenID = _allNfts[lastTokenIndex];

        _allNfts[tokenIndex] = lastTokenID;
        _idToNftIndex[lastTokenID] = tokenIndex;

        delete _idToNftIndex[tokenId];
        _allNfts.pop();
    }

}
